import React, { useState } from 'react';
import {
  Dimensions,
  FlatList,
  Image,
  Modal,
  Pressable,
  StyleSheet,
  View
} from 'react-native';

type PhotosProps = {
  roomId: string | number;
};

const samplePhotos = [
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',

];

const numColumns = 3;
const screenWidth = Dimensions.get('window').width;
const imageSize = screenWidth / numColumns - 16;

const Photos = ({ roomId }: PhotosProps) => {
  const [selectedImage, setSelectedImage] = useState<string | null>(null);

  const openImage = (uri: string) => setSelectedImage(uri);
  const closeImage = () => setSelectedImage(null);

  return (
    <View style={styles.container}>
      <FlatList
        data={samplePhotos}
        keyExtractor={(item, index) => index.toString()}
        numColumns={numColumns}
        renderItem={({ item }) => (
          <Pressable onPress={() => openImage(item)} style={styles.imageWrapper}>
            <Image source={{ uri: item }} style={styles.image} />
          </Pressable>
        )}
      />

      <Modal visible={!!selectedImage} transparent={true} onRequestClose={closeImage}>
        <View style={styles.modalOverlay}>
          <Pressable style={styles.fullImageWrapper} onPress={closeImage}>
            <Image source={{ uri: selectedImage! }} style={styles.fullImage} resizeMode="contain" />
          </Pressable>
        </View>
      </Modal>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
  },
  imageWrapper: {
    padding: 8,
    paddingLeft: 0,
  },
  image: {
    width: imageSize,
    height: imageSize,
    borderRadius: 6,
  },
  modalOverlay: {
    flex: 1,
    backgroundColor: '#000',
    justifyContent: 'center',
    alignItems: 'center',
  },
  fullImageWrapper: {
    width: '100%',
    height: '100%',
  },
  fullImage: {
    width: '100%',
    height: '100%',
  },
});

export default Photos;